function changelogLine(e){var t=new Date(e.date.replace(/-/,"/")),o=["January","February","March","April","May","June","July","August","September","October","November","December"],n=o[t.getMonth()],i=t.getUTCDate(),a=t.getFullYear();$("<tr><td><a href='"+e.link+"'>"+e.version+"</a></td><td>"+e.description+"</td><td>"+n+"-"+i+"-"+a+"</td></tr>").appendTo("table")}$(document).ready(function(){$.getJSON(chrome.extension.getURL("settings/changelog/changelog.json"),function(e){for(i=0;i<e.length;i++)line=e[i],changelogLine(0==i?line:line)})});